app.use(function (req, res, next) {
  var allowedOrigins = [
  'http://10.254.182.180:5005',
  'http://localhost:3000',
  'http://ec2-54-159-173-182.compute-1.amazonaws.com'];

  var origin = req.headers.origin;
  if (allowedOrigins.indexOf(origin) > -1) {
